.baseline {
  position: relative; }
  .baseline:after {
    position: absolute;
    width: auto;
    height: auto;
    z-index: 9999;
    content: '';
    display: block;
    pointer-events: none;
    top: -4px;
    right: 0;
    bottom: 0;
    left: 0;
    background-repeat: repeat;
    background-size: 100% 4px;
    background-position: top left;
